'''{{lj|東方幻想界_-妖々夢の音-}}'''是由[[狐之工作室]]制作并发行的东方同人专辑，该专辑首次发行于2010年3月14日的上，会场售价为1000日元，通贩售价为1365日元
===介绍===
作为第二作《{{lj|妖々夢の音（仮）}}》的正式作品，本专辑少了几许宏大壮伟，反而多了几分悠扬宁静，同时本专辑的部分曲目中也别出心裁地加入了钢琴独奏的段落，乐曲哀而不伤，在纷杂的旋律中又能找到一丝寂静寥落的感觉
